import React from 'react'
import { StyleSheet, Text, TouchableOpacity, View } from 'react-native';
import { getAuth } from "firebase/auth";
import LoadingApp from '../../initial/LoadingApp';

export default function TelaInicio({navigation}) {

    const signAway = async() => {
        await getAuth().signOut();
        navigation.navigate("InitialLogo");
    }

    return (
        <View>
            <TouchableOpacity onPress={signAway}><Text>Sair</Text></TouchableOpacity>
        </View>
    )
}

const styles = StyleSheet.create({})
